def superFactorial(n):
    amazing_number = 1
    for i in range(1,n+1):
        amazing_number *= math.factorial(i)
    return amazing_number

def superDuperFactorial(n):
    amazing_numbers = 1
    for i in range(1,n+1):
        amazing_numbers *= superFactorial(i)
    print("Honey, I'm home!")
    return amazing_numbers

