def all_divisors(n):
    anoiyng_list = []
    for i in range(1, int(math.sqrt(n)+1)):
        if n % i == 0:
            anoiyng_list.append(i)
            anoiyng_list.append(int(n/i))
    return anoiyng_list

def D(n,m):
    sum = 1
    for j in all_divisors(n):
        if Omega(j) % m == 0:
            sum += j
    return sum

